import { useState, useEffect, use } from 'react';

function ShowImages() {
  const [imgs, setImgs] = useState([])
  const [text, setText] = useState([])

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("http://localhost:3000/data-scrapper")
      const output = await response.json()

      setImgs(output.imgs)
      setText(output.text)
  
      console.log(output)
    }
    getData()
  }, [])

  return (
    <div>
      {imgs.map((img, index) => {
          return(
            <>
              <img key={index} src={img} alt=''></img>

              {text.map((text, index) => {
                  return(
                    <>
                      <p key={index}>P/L {text[index].pl}</p>
                  <p key={index}>P/VP {text[index].pvp}</p>
                  <p key={index}>DY {text[index].dy}</p>
                  <p key={index}>ROE {text[index].roe}</p>
                    </>
                  ) 
                })
              }
            </>
          ) 
        })
      }
    </div>
  );
}

export default ShowImages
